/*
script_selector.js is the old and deprecated way to launch the script.
This script only calls the new file to maintain compatibility.
*/
(function() {
  // Include new script file
  var url = "https://spun.github.io/dsc/dist/main.js";
  var scriptElement = document.createElement("script");
  scriptElement.setAttribute("src", url);
  document.body.appendChild(scriptElement);
})();
